import React, { useContext, useEffect, useState } from 'react';
import Navbar from './navbar';
import { Link } from 'react-router-dom';
import { dataContext } from './DataContext';
import axios from 'axios';
import '../css-components/productAdmin.css';
import '../css-components/carga.css';

const ProductsAdmin = () => {
  const { data, setData } = useContext(dataContext);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/productos')
      .then((res) => {
        setData(res.data);
        setLoading(false); 
        console.log(res.data);
      })
      .catch((error) => {
        console.error('Error al recuperar los productos: ', error);
      });

    axios.get('http://127.0.0.1:5000/usuariorol', { withCredentials: true })
      .then((res) => {
        const rol = res.data.message;
        if (rol === 'no' || (rol === 'siu' && window.location.href === 'http://localhost:3000/productsAdmin')) {
          window.location = 'home';
        }
        if (rol === 'si') {
          setLoading(false);
        }
      })
      .catch((error) => {
        console.error('Error al recuperar los productos: ', error);
      });
  }, []);

  const DeleteProduct = (id) => {
    console.log('Eliminando producto con id:', id);
    axios.delete(`http://127.0.0.1:5000/productos/${id}`)
      .then((res) => {
        setData(data.filter(product => product._id !== id));
      })
      .catch((error) => {
        console.error('Error al eliminar el producto: ', error);
      });
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-message">Cargando...</div>
      </div>
    );
  }

  return (
    <div>
      <Navbar />
      <table id="table-admin" className="table table-light">
        <thead className="thead-dark">
          <tr>
            <th scope="col">Nombre</th>
            <th scope="col">Categoria</th>
            <th scope="col">Color</th>
            <th scope="col">Precio</th>
            <th scope="col">Talla</th>
            <th scope="col">Marca</th>
            <th scope="col">Genero</th>
            <th scope="col">Acciones</th>
          </tr>
        </thead>
        <tbody>
          {data.map((product) => {
            return (
              <tr key={product._id}>
                <td>{product.nombre}</td>
                <td>{product.categoria}</td>
                <td>{product.color}</td>
                <td>{product.costo}</td>
                <td>{product.talla}</td>
                <td>{product.marca}</td>
                <td>{product.genero}</td>
                <td>
                  <Link to={`/productsEdit/${product.nombre}`} className="btn btn-primary">
                    Editar
                  </Link>
                  <button
                    className="btn btn-danger"
                    onClick={() => {
                      DeleteProduct(product.nombre);
                    }}
                  >
                    Eliminar
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
      <Link to="/productsNew" className="btn btn-success" role="button" aria-pressed="true">
        New Product
      </Link>
    </div>
  );
};

export default ProductsAdmin;
